  var formattedResponse = {};
  axios.all([axios.get(apiUrl + 'items/' + productId), axios.get(apiUrl + 'items/' + productId + '/description')]).then(axios.spread(function (product, description) {
    formattedResponse.author = getAuthor();
    formattedResponse.item = setItemValues(product.data, description.data);

    // This is not a requirement of the test, I Just want
    // to get the categories to show it them on the page, like in the designs
    axios.get(apiUrl + 'categories/' + product.data.category_id).then(function (response) {
      formattedResponse.categories = response.data.path_from_root.map(function (category) {
        return category.name;
      });
      res.json(formattedResponse);
    });
  }));
